import React from 'react';
import copa from './img/copa.png';
import copa2 from './img/copa2.png';
import copa3 from './img/copa3.png';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faClock } from '@fortawesome/free-solid-svg-icons';

function Ranking () {
    return (
        <div>
            Ranking<br/><br/>
             <div style = {row}>

                    <button style = {botonEdita}>
                        <div style = {row}>

                         <FontAwesomeIcon icon={faClock} />  &nbsp; &nbsp;
                         <div style = {historicStyle}> Històric </div>
                        </div>
                    </button>

             </div>

            <div style = {rowH}>

                <div style = {mesTitle}>
                    Juny 2021
                </div>

                <div style = {rowBoarder}>
                    <div style = {column}>
                        <div style = {mes}> <img src={copa2} style = {widthMax2}></img></div><br/>
                        <div style = {mes}> JoanCarles21 </div>
                    </div>
                    <div style = {column}>
                        <div style = {mes}> <img src={copa} style = {widthMax}></img></div>
                        <div style = {mes}> Voluntari1995 </div>
                    </div>
                    <div style = {column}>
                        <div style = {mes}> <img src={copa3} style = {widthMax2}></img></div><br/>
                        <div style = {mes}> joanetDamm </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

const column = {
    float: "left",
    width: "33%",
    padding: "10px"
};
const row = {
      display: "flex"
};
const rowBoarder = {
    display: "flex",
    borderStyle: "groove",
      
};
const rowH = {
      padding: "4%"
};
const botonEdita = {
    padding: "7px 10px 0px 10px",
    marginRight: "15%",
    marginLeft:"auto"
};
const  historicStyle= {
      fontSize: 22

};
const  mesTitle = {
    fontSize: 22,
    borderStyle: "groove",
    justifyContent: "center",
    display: "flex"

};
const  mes = {
    fontSize: 22,
    justifyContent: "center",
    display: "flex"

};
const widthMax = {
        width: "60%",
        height: "auto",

        justifyContent: "center",
        display: "flex"
};
const widthMax2 = {
        width: "30%",
        height: "auto",
        paddingTop: "80px",
        justifyContent: "center",
        display: "flex"
};
export default Ranking;
